window.bookSummaryJSON = "<p><b><i>Find Another Dream</i></b><b>, written and performed by Maysoon Zayid, is the true story of how a Muslim Jersey girl with cerebral palsy creates her own path to stardom.</b>&nbsp;</p> <p>The daughter of Palestinian immigrants, as a child she dreamed of one day dancing on Broadway. As a teen, a bubble-bursting choreographer told her to “find another dream”, so she set her sights on becoming a soap star, undeterred by the fact that the odds were against her.&nbsp;While chasing fame, she found her voice in stand-up comedy, performing in multiple languages in sold-out shows all over the world.&nbsp;</p> <p>When not touring, Maysoon Zayid is a passionate advocate who fights for access to education for disabled students worldwide and battles bullying online. In this Audible Original x Hello Sunshine, Maysoon tells tales of family, friendship, love, and career. She takes us on a hilarious, poignant journey of failures and successes. When her dreams turn into nightmares, she finds another dream until finally, the one she least expected comes true.&nbsp;</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
